//SPDX-License-Identifier: UNLICENSED
pragma solidity >=0.5.0;
// solidity doesn't yet support 2 levels of dynamic arrays, needed for string[]
pragma experimental ABIEncoderV2;
contract Satellites {


     struct SatInfo {
        uint id;
        string name;
        // fixed (float numbers) are nut fully supported, convert from string when neccessary fixed256x8
        string longitude;
        string latitude;
        string elevation;
        string azimuth;
        string timestamp;
    }
    //instant of SatInfo struct, incorrect method
    // SatInfo sat;
    // address being account address
    mapping (uint => SatInfo) public sat;
    //address[] public 
    // set the satellite contracts current values
        //function set(string[6] memory satInfo, address _address,uint id_) public {

    function set( uint _address, uint id_, string memory name_ , string memory longitude_, string memory latitude_, string memory elevation_, string memory azimuth_,
    string memory timestamp_) public {
        // reorder these in the order presented on track
        sat[_address].id = id_;
        sat[_address].name = name_;
        sat[_address].longitude = longitude_;
        sat[_address].latitude = latitude_;
        sat[_address].elevation = elevation_;
        sat[_address].azimuth = azimuth_;
        sat[_address].timestamp = timestamp_;
    }
    // retrieves a struct of type SatInfo
    //function get(uint id) view public   returns (SatInfo memory) {
    function get()  view public  returns (uint , string memory, string memory, 
    string memory, string memory, string memory, string memory) {
        return ( sat[0].id, sat[0].name, sat[0].latitude,sat[0].latitude,sat[0].elevation,sat[0].azimuth,sat[0].timestamp);
    }
}
